import { useQuery } from "react-query";
import { fetchCoinPrice } from "../api";
import styled from "styled-components";

const DivContainer = styled.div`
  background-color: white;
  align-items: center;
  border-radius: 15px;
  height: 23px;
`;

const SpanContainer = styled.p`
  color: black;
  text-align: center;
  font-size: 20px;
`;

interface IPrice {
  time_open: number;
  time_close: number;
  open: string;
  high: string;
  low: string;
  close: string;
  volume: string;
  market_cap: number;
}
interface PriceProps {
  coinId: string;
}
function Price({ coinId }: PriceProps) {
  const { isLoading, data } = useQuery<IPrice[]>(["priceQuery"], () =>
    fetchCoinPrice(coinId)
  );
  return (
    <div>
      {isLoading ? (
        "Loading Price....."
      ) : (
        <DivContainer>
          <SpanContainer>
            HIGH :{data?.map((value) => value.close.indexOf)}
          </SpanContainer>
        </DivContainer>
      )}
    </div>
  );
}

export default Price;
